```
function isValidRomanNumeral(str) {
  const romanNumerals = {
    'I': 1,
    'V': 5,
    'X': 10,
    'L': 50,
    'C': 100,
    'D': 500,
    'M': 1000,
  };

  let total = 0;
  for (let i = 0; i < str.length; i++) {
    const char = str[i];
    if (romanNumerals[char]) {
      total += romanNumerals[char];
    } else {
      return false;
    }
  }

  return total === parseInt(str, 10);
}
```
This function first defines a object that maps each Roman numeral character to its numerical value. Then, it iterates through the input string, checks each character against the object, and adds up the values of the valid characters. Finally, it compares the total value to the parseInt of the input string to ensure that it's a valid Roman numeral.

You can test this function with some examples:
```
console.log(isValidRomanNumeral('IV')); // true
console.log(isValidRomanNumeral('XC')); // true
console.log(isValidRomanNumeral('MCMXC')); // true
console.log(isValidRomanNumeral(' ABC')); // false
```
